import "../index.css"
import {useEffect,useState} from "react"
function refresh(){
    alert('Hello')
}
/*
onClick後 會去後端拉資料 顯示在前端
*/
/*
next : json Server資料 放在表單
*/ 
const List = ()=>{
    const [data,setData] = useState({});
    
    const fetchData = ()=>{
        fetch('http://localhost:3000/posts/1')
        .then(res => res.json())
        .then(data =>{
            setData(data.data);
            console.log(data.data);
        })
    }
    
    useEffect(()=>{
        fetchData()
    },[])
    
    
    return <div className="list">
            <select name="data" size="2" multiple>
                
            </select>
    </div>     
}

export default List;
